.macro tutorialScreen
    # $s0 = bitmap base (dst)
    la    $t1, tutorialScreen_sprite      # src pointer
    move  $t2, $s0          # dst pointer
    li    $t3, 16384      # pixels remaining

tutorialScreen_loop:
    slti  $t0, $t3, 8   # $t0=1 if remaining < unroll
    bnez  $t0, tutorialScreen_rem
    nop
    lw    $t0, 0($t1)
    sw    $t0, 0($t2)
    lw    $t4, 4($t1)
    sw    $t4, 4($t2)
    lw    $t5, 8($t1)
    sw    $t5, 8($t2)
    lw    $t6, 12($t1)
    sw    $t6, 12($t2)
    lw    $t7, 16($t1)
    sw    $t7, 16($t2)
    lw    $t8, 20($t1)
    sw    $t8, 20($t2)
    lw    $t9, 24($t1)
    sw    $t9, 24($t2)
    lw    $t0, 28($t1)
    sw    $t0, 28($t2)
    addiu $t1, $t1, 32
    addiu $t2, $t2, 32
    addiu $t3, $t3, -8
    b     tutorialScreen_loop
    nop

tutorialScreen_rem:
    beqz  $t3, tutorialScreen_done
    nop
tutorialScreen_rem_loop:
    lw    $t4, 0($t1)
    sw    $t4, 0($t2)
    addiu $t1, $t1, 4
    addiu $t2, $t2, 4
    addiu $t3, $t3, -1
    bnez  $t3, tutorialScreen_rem_loop
    nop

tutorialScreen_done:
.end_macro
